import React from "react";
import {
  FullSwiper
} from "./FullSwiper";
import {SwiperContainer} from "./SwiperElements"
const SwiperSection = () => {
  return (
    <SwiperContainer>
      <FullSwiper />
      <div class="swiper-button-prev swiper-button-white"></div>
      <div class="swiper-button-next swiper-button-white"></div>
    </SwiperContainer>
  );
};

export default SwiperSection;
